        "summary": "Ricottan Orange Pound Cake With Amaretto Strawberries takes roughly <b>45 minutes</b> from beginning to end. This recipe makes 8 servings with <b>438 calories</b>, <b>11g of protein</b>, and <b>31g of fat</b> each. For <b>$1.41 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. It works well as a dessert. This recipe is liked by 2 foodies and cooks. A mixture of vanillan extract, sugar, eggs, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 26%</b>, which is rather bad. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/orange-ricotta-pound-cake-with-strawberries-527155\">Orange Ricotta Pound Cake with Strawberries</a>, <a href=\"https://spoonacular.com/recipes/ricotta-orange-pound-cake-616750\">Ricotta-Orange Pound Cake</a>, and <a href=\"https://spoonacular.com/recipes/orange-ricotta-pound-cake-66191\">Orange Ricotta Pound Cake</a>.",
