        "summary": "Banana Pudding Cake requires about <b>45 minutes</b> from start to finish. For <b>$2.36 per serving</b>, you get a dessert that serves 12. One portion of this dish contains roughly <b>12g of protein</b>, <b>21g of fat</b>, and a total of <b>520 calories</b>. It is brought to you by Foodista. Head to the store and pick up eggs, vanilla wafers, vanillan extract, and a few other things to make it today. 3 people were glad they tried this recipe. Taking all factors into account, this recipe <b>earns a spoonacular score of 34%</b>, which is rather bad. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/banana-pudding-cake-735378\">Banana Pudding Cake</a>, <a href=\"https://spoonacular.com/recipes/banana-pudding-cake-1025391\">Banana Pudding Cake</a>, and <a href=\"https://spoonacular.com/recipes/banana-caramel-pudding-cake-341507\">Banana Caramel Pudding Cake</a>.",
