        "occasions": [],
        "instructions": "<ol><li>In a large bowl, beat egg yolks with sugar and set aside.</li><li>In bowl of an electric mixer, whip egg whites until stiff.</li><li>Add baking powder, processed wafers, and cocoa to egg yolk mixture.</li><li>Drop about 1/4 of egg whites into larger bowl and fold lightly.  Fold in remaining whites carefully.</li><li>Line a jellyroll sheet pan with parchment paper covering all sides and spray paper with non-stick floured baking spray.  Spread cake batter onto paper, so it covers the entire pan.</li><li>Bake in a preheated oven at 350 degrees for 15-20 minutes.</li><li>Let cake cool completely on sheet (at least 30 minutes to an hour).*</li><li>As cake cools, mix sugar, flour and salt in top of a double boiler.  (If you dont have a double boiler, a larger saucepan on top a smaller saucepan with water boiling works just fine!)</li><li>Blend in egg yolks and milk. Cook, uncovered, over boiling water, stirring constantly for 10 to 12 minutes or until thickened.</li><li>Remove from heat.  Stir in vanilla.</li><li>When cake is cooled, carefully lift the parchment paper, remove from pan and place on a flat surface.  Starting from the short end, cut into three even pieces.</li><li>Place first layer of cake on a serving platter.  Spread half of the custard over the top of the cake, then cover with one third of the banana slices.  Take about one third of the crumbled wafers and sprinkle over custard-banana layer. Top with next piece of cake and repeat, being sure to reserve a few bananas and crumbled cookies.</li><li>Spread the final amount of custard onto the top layer of cake, and refrigerate the whole cake for at least 2 hours or until ready to serve.</li><li>Just before serving, make whipped cream topping.  Combine all ingredients together in a large mixing bowl until cream thickens and becomes stiff.</li><li>Spread whipped cream on cake and top with remaining banana and wafers.*</li><li>You can even spread the whipped cream on the final cake layer and refrigerate all together.  We suggest not topping the cake with the fresh bananas and cookies until you are ready to serve, however.  Otherwise, the bananas will brown.  Keep them fresh by sprinkling with a bit of lemon juice and placing them in an airtight container until ready to use.</li></ol>",
