        "summary": "Roasted Butternut Squash and Sage Dip is a hor d'oeuvre that serves 2. One serving contains <b>465 calories</b>, <b>9g of protein</b>, and <b>35g of fat</b>. For <b>$2.73 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. 3 people have tried and liked this recipe. This recipe from Foodista requires two butternut squash, olive oil, ground pepper, and garlic powder. <b>The Super Bowl</b> will be even more special with this recipe. It is a good option if you're following a <b>gluten free, primal, and pescatarian</b> diet. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 80%</b>, which is pretty good. Try <a href=\"https://spoonacular.com/recipes/roasted-butternut-squash-with-sage-1239315\">Roasted Butternut Squash with Sage</a>, <a href=\"https://spoonacular.com/recipes/roasted-butternut-squash-and-sage-gnocchi-535328\">Roasted Butternut Squash and Sage Gnocchi</a>, and <a href=\"https://spoonacular.com/recipes/roasted-butternut-squash-with-pecans-and-sage-707573\">Roasted Butternut Squash with Pecans and Sage</a> for similar recipes.",
