        "summary": "The recipe Pork Menudo can be made <b>in approximately 45 minutes</b>. One serving contains <b>990 calories</b>, <b>38g of protein</b>, and <b>49g of fat</b>. For <b>$4.54 per serving</b>, this recipe <b>covers 42%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. 3 people have made this recipe and would make it again. This recipe from Foodista requires size bell pepper, bell pepper, potatoes, and chorizo. It works well as a rather pricey main course. It is a good option if you're following a <b>gluten free and dairy free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is super. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/pork-menudo-1423925\">Pork Menudo</a>, <a href=\"https://spoonacular.com/recipes/pork-menudo-1259415\">Pork Menudo</a>, and <a href=\"https://spoonacular.com/recipes/pork-menudo-1497429\">Pork Menudo</a>.",
