        "summary": "Turkey and Sausage Boulettes requires roughly <b>45 minutes</b> from start to finish. For <b>$2.56 per serving</b>, you get a main course that serves 6. One portion of this dish contains approximately <b>35g of protein</b>, <b>30g of fat</b>, and a total of <b>484 calories</b>. Not a lot of people made this recipe, and 5 would say it hit the spot. It is brought to you by Foodista. Head to the store and pick up oil, egg, sausage meat, and a few other things to make it today. Overall, this recipe earns a <b>good spoonacular score of 60%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/shrimp-boulettes-244617\">Shrimp Boulettes</a>, <a href=\"https://spoonacular.com/recipes/ragot-de-boulettes-et-de-pattes-de-cochon-or-so-it-will-have-you-believe-551323\">Ragoût de boulettes et de pattes de cochon – Or so it will have you believe…</a>, and <a href=\"https://spoonacular.com/recipes/marys-cajun-beef-pork-boulettes-with-brown-sauce-245038\">Mary's Cajun Beef & Pork Boulettes with Brown Sauce</a>.",
