        "instructions": "<ol><li>Soak the bread in the milk.</li><li>In a large skillet over medium high heat warm the oil.  Add the onion and cook stirring for about 3 minutes. Add the mushrooms and the parsley and cook 5 minutes or until there is no more juices running from the mushrooms.</li><li>In a large mixing bowl, mix the turkey and the sausage meat.</li><li>Add the egg, parmesan cheese, sage, squeeze the milk out of the bread and add the bread to the meat mixture.</li><li>Add the onion mixture and mix well. Season with salt and pepper. Mix everything together until the bread is well worked in and the vegetables are evenly distributed.</li><li>Place in the refrigerator for 10 minutes  to solidify.</li><li>With your hands form individual meat boulettes or patties. Roll them on the bread crumbs and place them on a large piece of parchment paper.</li><li>In a very large skillet over medium high heat, add the oil. When the oil is hot but not burning, saut the meat until golden brown and no juices are running out when slightly pressed down.</li><li>Remove from the pan  and place on paper towel before serving.</li></ol>",
