        "summary": "Strawberry Banana Stuffed Pancakes is a breakfast that serves 2. One portion of this dish contains approximately <b>10g of protein</b>, <b>1g of fat</b>, and a total of <b>171 calories</b>. For <b>$1.14 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up baking soda, sugar, salt, and a few other things to make it today. 19 people found this recipe to be tasty and satisfying. It can be enjoyed any time, but it is especially good for <b>Mother's Day</b>. From preparation to the plate, this recipe takes about <b>30 minutes</b>. It is brought to you by Foodista. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 72%</b>. This score is solid. <a href=\"https://spoonacular.com/recipes/strawberry-banana-pancakes-547238\">Strawberry Banana Pancakes</a>, <a href=\"https://spoonacular.com/recipes/strawberry-banana-pancakes-471475\">Strawberry Banana Pancakes</a>, and <a href=\"https://spoonacular.com/recipes/strawberry-banana-chia-seed-pancakes-592504\">Strawberry Banana Chia Seed Pancakes</a> are very similar to this recipe.",
