        "image": "https://spoonacular.com/recipeImages/644848-556x370.jpg",
        "imageType": "jpg",
        "summary": "You can never have too many breakfast recipes, so give Gluten Free Pancakes a try. This recipe serves 12. Watching your figure? This gluten free and lacto ovo vegetarian recipe has <b>105 calories</b>, <b>3g of protein</b>, and <b>6g of fat</b> per serving. For <b>34 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. A mixture of preferred milk alternative, baking powder, warm water, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. 2 people were glad they tried this recipe. It is brought to you by Foodista. With a spoonacular <b>score of 12%</b>, this dish is not so amazing. Try <a href=\"https://spoonacular.com/recipes/2-ingredient-sweet-potato-pancakes-gluten-free-dairy-free-nut-free-1224983\">2-ingredient Sweet Potato Pancakes {gluten-free, dairy-free, nut-free}</a>, <a href=\"https://spoonacular.com/recipes/2-ingredient-sweet-potato-pancakes-gluten-free-dairy-free-nut-free-630749\">2-ingredient Sweet Potato Pancakes {gluten-free, dairy-free, nut-free}</a>, and <a href=\"https://spoonacular.com/recipes/2-ingredient-sweet-potato-pancakes-gluten-free-dairy-free-nut-free-1379303\">2-ingredient Sweet Potato Pancakes {gluten-free, dairy-free, nut-free}</a> for similar recipes.",
