        "instructions": "<ol><li>Start by making the buttermilk. Mix together the almond milk and vinegar, set aside.</li><li>In a large bowl, whisk together all of the dry ingredients: almond flour, tapioca flour, xanthan gum, salt, and baking powder.</li><li>In a medium-sized bowl, whisk together all of the wet ingredients: agave nectar, eggs, milk mixture, water, and vanilla.</li><li>Whisk the wet ingredients into the dry, mixing well. Add warm water one tablespoon at a time if the batter needs to be thinned out more.</li><li>Heat a skillet or griddle over medium heat.</li><li>Lightly grease the skillet and, using an ice cream scoop, pour in the batter. Then, spread it out with the back of a spoon.</li><li>Cook for 1 minute, or until the bottom of the pancake is firm.</li><li>Flip it over, squish it down with a spatula, and cook an additional 1-2 minutes or until done.</li><li>Set aside on a plate and repeat with the remaining batter. Makes 10-12 pancakes.</li><li>Serve with Earth Balance butter and syrup or fruit. Delicious!</li></ol>",
