        "summary": "Spicy Lemongrass Soup could be just the <b>dairy free, lacto ovo vegetarian, and vegan</b> recipe you've been looking for. This recipe serves 4. This hor d'oeuvre has <b>245 calories</b>, <b>7g of protein</b>, and <b>8g of fat</b> per serving. For <b>$3.13 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. If you have lemongrass, garlic, ginger, and a few other ingredients on hand, you can make it. This recipe from Foodista has 13 fans. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 68%</b>. This score is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/spicy-lemongrass-soup-1243211\">Spicy Lemongrass Soup</a>, <a href=\"https://spoonacular.com/recipes/spicy-lemongrass-crab-46854\">Spicy Lemongrass Crab</a>, and <a href=\"https://spoonacular.com/recipes/spicy-mussels-with-ginger-and-lemongrass-42117\">Spicy Mussels with Ginger and Lemongrass</a>.",
