        "summary": "Beer Can Chicken, Country Style Vegetables with Roasted Garlic could be just the <b>gluten free and dairy free</b> recipe you've been looking for. This recipe serves 4 and costs $5.66 per serving. This main course has <b>818 calories</b>, <b>46g of protein</b>, and <b>45g of fat</b> per serving. 2 people were impressed by this recipe. Head to the store and pick up paprika, salt, chilli flakes, and a few other things to make it today. <b>Father's Day</b> will be even more special with this recipe. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns an <b>awesome spoonacular score of 81%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/braised-country-style-pork-ribs-roasted-vegetables-and-gravy-522816\">Braised country style pork ribs, roasted vegetables and gravy</a>, <a href=\"https://spoonacular.com/recipes/maple-glazed-chicken-with-roasted-country-vegetables-315705\">Maple Glazed Chicken with Roasted Country Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/beer-braised-country-style-pork-ribs-375953\">Beer-Braised Country-Style Pork Ribs</a>.",
