        "summary": "Roasted Strawberry Coconut Milk Ice Cream requires approximately <b>45 minutes</b> from start to finish. For <b>$1.44 per serving</b>, you get a dessert that serves 8. One portion of this dish contains about <b>2g of protein</b>, <b>21g of fat</b>, and a total of <b>213 calories</b>. This recipe is liked by 2 foodies and cooks. Head to the store and pick up cane sugar, strawberries, a vanilla bean, and a few other things to make it today. It can be enjoyed any time, but it is especially good for <b>Mother's Day</b>. It is a good option if you're following a <b>gluten free, dairy free, lacto ovo vegetarian, and fodmap friendly</b> diet. It is brought to you by Foodista. With a spoonacular <b>score of 34%</b>, this dish is not so great. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/roasted-strawberry-coconut-milk-ice-cream-vegan-tips-for-making-your-homemade-ice-cream-soft-814136\">Roasted Strawberry Coconut Milk Ice Cream (Vegan) + Tips for Making Your Homemade Ice Cream Soft</a>, <a href=\"https://spoonacular.com/recipes/roasted-strawberry-coconut-milk-ice-cream-1738147\">Roasted Strawberry Coconut Milk Ice Cream</a>, and <a href=\"https://spoonacular.com/recipes/roasted-strawberry-coconut-milk-ice-cream-58018\">Roasted Strawberry Coconut Milk Ice Cream</a>.",
