                        "number": 1,
                        "step": "Remove the vanilla bean halve from the ice cream base and discard it.  Process the mixture according to the manufacturer's instructions on your ice cream maker.  I added in the strawberries after about 10 minutes when the mixture starting getting thicker and gaining a bit of volume.  Eat immediately (it will be somewhat soft), or place in an airtight container in the freezer.  Makes approximately 6 to 8 servings.",
