        "summary": "Cranberry Crumb Bars is a <b>lacto ovo vegetarian</b> hor d'oeuvre. For <b>29 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. This recipe serves 24. One serving contains <b>163 calories</b>, <b>2g of protein</b>, and <b>9g of fat</b>. If you have vanilla, butter, baking powder, and a few other ingredients on hand, you can make it. A couple people made this recipe, and 18 would say it hit the spot. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 16%</b>, which is rather bad. <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-55831\">Cranberry Crumb Bars</a>, <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-585182\">Cranberry Crumb Bars</a>, and <a href=\"https://spoonacular.com/recipes/cranberry-crumb-bars-128334\">Cranberry Crumb Bars</a> are very similar to this recipe.",
