        "occasions": [],
        "instructions": "<ol><li>Preheat the oven to 375 degrees F. Butter a 913 inch pan.</li><li>In a medium bowl, mix together 1 cup sugar, flour, almond flour, salt and baking powder. Use a fork or pastry cutter to blend in the butter and egg. The dough will be crumbly. Alternatively, you can pulse the dry ingredients in a food processor with the butter until pebbly, and then mix in the egg until it all comes together. Pat half of the dough into the buttered pan.</li><li>In another bowl, stir together the sugar, cornstarch, vanilla, and orange juice. Mix in the cranberries. Sprinkle the cranberry mixture evenly over the dough in the pan.</li><li>Add 1/4 tsp cinnamon to the remaining dough, then crumble dough over the berries. Bake for 45-55 minutes, or until top is a light golden brown. Cool completely and chill in the refrigerator before cutting into squares. Store in an airtight container in the refrigerator.</li><li>Just toss almonds in a food processor until finely ground to make almond meal.</li></ol>",
