        "instructions": "<p>I used frozen cassava because it is a time saver! So no judging. In a pot with salted water cook the cassava also known as in Spanish yuca until fork tender.</p><p>Once the cassava is cooked throughly, mash it till smooth. Then add in the sardines, cheese, egg yolks, baking powder, salt, pepper, and cilantro/parsley, mix well.</p><p>Preheat oil in frying pan. With wet hands start forming balls with the sardine batter, dip it in the egg whites then roll it in the bread crumbs, use all the batter. Fry corquettes till golden brown on all sides. Let it rest on a double-lined paper towel to remove excess oil. Serve with ketchup.</p>",
