        "summary": "Forget going out to eat or ordering takeout every time you crave Mexican food. Try making Authentic Chicken Enchiladas at home. This recipe makes 12 servings with <b>370 calories</b>, <b>24g of protein</b>, and <b>11g of fat</b> each. For <b>$1.29 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 54 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. If you have pickled jalapeno in a jar), olive oil, enchilada sauce, and a few other ingredients on hand, you can make it. It works well as a main course. It is brought to you by Foodista. It is a good option if you're following a <b>gluten free</b> diet. With a spoonacular <b>score of 70%</b>, this dish is good. Similar recipes are <a href=\"https://spoonacular.com/recipes/authentic-chicken-enchiladas-1477459\">Authentic Chicken Enchiladas</a>, <a href=\"https://spoonacular.com/recipes/authentic-chicken-enchiladas-1604075\">Authentic Chicken Enchiladas</a>, and <a href=\"https://spoonacular.com/recipes/authentic-chicken-enchiladas-1000767\">Authentic Chicken Enchiladas</a>.",
