        "instructions": "<ol><li>Pour ingredients into shaker and fill with ice. Shake well and serve unstrained, on the rocks. Add one or two pear-lemon ice cubes to taste and garnish with a fresh Bing cherry or lemon twist, if desired.</li><li>To make the Pear-lemon ice cubes:</li><li>Whisk the pear juice with the lemon juice and a small pinch of salt. Add some simple syrup or water to thin slightly, if necessary. Pour the liquid into a pitcher and use it to fill the cavities of two ice cube trays almost to the top. Leave in freezer for at least 3 hours or until completely frozen. This recipe makes enough to fill two standard ice cube trays.</li></ol>",
