        "summary": "Cajun Lobster Pasta could be just the <b>gluten free and primal</b> recipe you've been looking for. For <b>$5.4 per serving</b>, this recipe <b>covers 45%</b> of your daily requirements of vitamins and minerals. One serving contains <b>684 calories</b>, <b>35g of protein</b>, and <b>50g of fat</b>. This recipe serves 1. 2 people have made this recipe and would make it again. This recipe is typical of Cajun cuisine. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. A mixture of garlic powder, bell pepper, lemon pepper, and a handful of other ingredients are all it takes to make this recipe so yummy. It is brought to you by Foodista. It works well as a main course. Taking all factors into account, this recipe <b>earns a spoonacular score of 76%</b>, which is pretty good. <a href=\"https://spoonacular.com/recipes/cajun-lobster-pasta-1396967\">Cajun Lobster Pasta</a>, <a href=\"https://spoonacular.com/recipes/cajun-lobster-pasta-1614055\">Cajun Lobster Pasta</a>, and <a href=\"https://spoonacular.com/recipes/red-lobster-cajun-chicken-pasta-138824\">Red Lobster Cajun Chicken Pasta</a> are very similar to this recipe.",
