        "instructions": "<ol><li>Cook up your bacon in a small frying pan over medium heat. Remove the bacon and drain off the fat, reserving about a tablespoon.</li><li>To the pan add in your garlic and pepper. Cook it up on medium heat for about two to three minutes.</li><li>Add in the green onions. Let cook for an additional minute.</li><li>Chop up your bacon and add it to the pan along with the broth. Love me some bacon.</li><li>Now add in your spices; the cajun, old bay, onion powder, garlic powder, lemon pepper, oregano, and pepper.</li><li>Allow the mixture to heat back up and then turn your heat down to medium low. Add in your lobster and allow it about three to five minutes to heat up completely.</li><li>Last up, add in your cream.</li><li>Serve your finished lobster over fresh cooked pasta with a few pinches of parmesan cheese and a sprinkle of chopped green onions over the top.</li></ol>",
