        "summary": "Butter-Bread is a <b>lacto ovo vegetarian</b> recipe with 6 servings. One serving contains <b>583 calories</b>, <b>12g of protein</b>, and <b>30g of fat</b>. For <b>78 cents per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up liquid malt extract, yeast, butter, and a few other things to make it today. 3 people were impressed by this recipe. It is brought to you by Foodista. From preparation to the plate, this recipe takes roughly <b>1 hour and 30 minutes</b>. Overall, this recipe earns a <b>not so excellent spoonacular score of 35%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/peanut-butter-banana-bread-we-call-it-savannah-bread-865600\">Peanut Butter Banana Bread: We Call It Savannah Bread</a>, <a href=\"https://spoonacular.com/recipes/chocolate-chunk-almond-butter-zucchini-bread-with-salted-maple-butter-1500505\">Chocolate Chunk Almond Butter Zucchini Bread with Salted Maple Butter</a>, and <a href=\"https://spoonacular.com/recipes/bread-baking-apple-butter-swirl-bread-203814\">Bread Baking: Apple Butter Swirl Bread</a>.",
        "cuisines": [],
        "dishTypes": [],
        "diets": [
            "lacto ovo vegetarian"
        ],
        "occasions": [],
        "instructions": "<ol><li>The night before you wish to make the bread, mix the starter dough ingredients together, cover and put in the fridge overnight. Take the butter and starter dough out of the fridge one hour before starting to make the bread, to bring it to room temperature.</li><li>Mix the yeast, malt extract, and water together until there are no lumps left. Then tip in the flour, salt, and butter and mix well. Mix in the starter dough mixture and knead for 10 minutes. As this is quite a wet dough it is best to this in a food processor (with the dough hook attachment), 5 minutes on a slow speed then 5 on a fast speed.</li><li>Tip the dough out onto a floured surface, dust with flour, cover, and leave for 30 minutes to rise. You will need quite a lo of flour for dusting as it is quite sticky. At 10 minute intervals, use your hands to punch flat the dough, stretch out and fold over the edges on themselves and turn over.</li><li>Grease the loaf tin. Shaking off any excess flour, form a loaf shape then put the dough in the tin. Cover and leave to rise for a further 30 minutes. After 10 minutes rising, use a very sharp knife to score a 2 cm line down the centre of the dough. This helps create a nice crust.</li><li>Preheat the oven to 230C. Put the bread on the middle shelf of the oven. Using the spray bottle, squirt on and around the bread to create steam. This keeps the bread moist and gives a nice crust. Bake for 45 minutes. After 15 minutes, spray again with water and turn the temperature down to 200C.</li><li>The bread is ready when a skewer inserted into the centre of the bread comes out clean. Difficult as it may be, leave the bread to cool completely on wire rack before slicing.</li></ol>",
