        "instructions": "<ol><li>Heat a large skillet to medium. Whisk the milk, eggs, salt, vanilla extract, sugar, cayenne pepper, and nutmeg together in a baking dish or large bowl.</li><li>Pour the coconut onto a plate. Pour enough oil in the skillet to completely coat the bottom. Dip each slice of bread into the egg mixture for 15-20 seconds per side.</li><li>Then dip the slices in the coconut on both sides for an even coat.</li><li>When the oil is hot, start frying one slice as a test batch. Cook for 1 minute per side. Watch for a crispy golden-brown crust. The coconut may turn a deep brown, but avoid BLACK! If the coconut burns before the crust has formed, turn the heat down a little.</li><li>Add more oil as needed and continue with the rest of the bread. Serve warm with maple syrup and berries!</li></ol>",
