        "instructions": "<ol><li>In a large bowl mix the butter and flour together until crumble (the butter must be at room temperature).</li><li>Then add in the egg (slightly beaten), water and salt and knead until the dough is not sticky anymore.</li><li>Put the dough in the fridge, Covered in plastic, until we make the filling.</li><li>Filling:</li><li>In a bowl mix the spinach (you SHOULD defrost the spinach and drain it very well Before, Usually I defrost it in the microwave about 10 to 15 min., That's easier) with the shredded cheese, sour cream, chopped dill, chopped onion and shredded carrots (very thin).</li><li>Beat the eggs and stir in (but keep one yolk for oiling the surface of the pie)</li><li>Season with salt and pepper as for your keys.</li><li>I used half pound of feta cheese in the filling But you CAN add 4.5 oz of feta and 3.5 oz of cheddar cheese (cheddar Makes the more homogenous the filling)</li><li>Preheat the oven at 356  F.</li><li>Now you CAN take out the dough from the fridge and divide it in two, one piece is for the bottom of the market and Should Be Bigger, The Other One Will Be for the top of the pie and Will Be Smaller. From the second one we Will make strips and We will make the grid.</li><li>Make the first sheet with the rolling pin a little bit Thicker, THEN oil the tray and put it inside Covering the sides of the tray.</li><li>Add in the filling, THEN make the other sheet and cut strips. Them interpolated on top of the pie and spread over the yolk mixed with 3 tbsp. of milk.</li><li>Cook until is nice roasted.</li><li>Enjoy! it's delightful!</li></ol>",
