        "summary": "Lasagne Roll Ups is a Mediterranean recipe that serves 6. This hor d'oeuvre has <b>569 calories</b>, <b>28g of protein</b>, and <b>25g of fat</b> per serving. For <b>$2.66 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. Not a lot of people made this recipe, and 2 would say it hit the spot. This recipe from Foodista requires salt, parmesan cheese, finely-chopped onion, and chicken broth. With a spoonacular <b>score of 74%</b>, this dish is solid. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/lasagne-roll-ups-1368315\">Lasagne Roll Ups</a>, <a href=\"https://spoonacular.com/recipes/lasagne-roll-ups-with-chunky-meat-sauce-624628\">Lasagne roll-ups with chunky meat sauce</a>, and <a href=\"https://spoonacular.com/recipes/cinnamon-roll-french-toast-roll-ups-798361\">Cinnamon Roll French Toast Roll Ups</a>.",
