        "summary": "Need a <b>gluten free and primal hor d'oeuvre</b>? Roasted Garlic & Butternut Parmesan Soup could be a super recipe to try. For <b>$1.1 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. This recipe serves 7. One serving contains <b>289 calories</b>, <b>9g of protein</b>, and <b>20g of fat</b>. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. It is brought to you by Foodista. From preparation to the plate, this recipe takes about <b>45 minutes</b>. A mixture of chicken stock, olive oil, milk, and a handful of other ingredients are all it takes to make this recipe so yummy. 2 people were impressed by this recipe. With a spoonacular <b>score of 77%</b>, this dish is solid. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/roasted-butternut-squash-with-parmesan-garlic-breadcrumbs-707571\">Roasted Butternut Squash with Parmesan-Garlic Breadcrumbs</a>, <a href=\"https://spoonacular.com/recipes/roasted-garlic-butternut-soup-404148\">Roasted Garlic Butternut Soup</a>, and <a href=\"https://spoonacular.com/recipes/butternut-squash-soup-with-roasted-garlic-38927\">Butternut Squash Soup With Roasted Garlic</a>.",
