        "instructions": "<ol><li>You will need a 9\" springform pan, or a cake pan with at least 2\" high sides, sprayed with baking spray or buttered and sprinkled with the 2T of sugar.</li><li>Preheat oven to 350 F</li><li>Zest one orange and add the zest to your mixing bowl.</li><li>Cut the peel off both oranges, removing all pith, and slice into 1/4\" rounds.</li><li>Cut the figs in half.</li><li>Combine the softened butter, orange zest, and sugar.  Beat until fluffy.</li><li>Add the eggs, heavy cream and vanilla extract. Beat well.</li><li>Sift the remaining dry ingredients into the batter and gently incorporate.</li><li>Layer the figs and orange slices into the pan and spoon the batter on top.</li><li>Gently spread the batter evenly over the whole and tap the pan to release air bubbles and ensure that the batter gets down into all the crevices between the fruit slices on the bottom.</li><li>Bake at 350 F for approximately forty-five minutes, or until tester comes out clean. Let cool slightly before inverting the cake onto a rack to cool completely.</li><li>While the cake is cooling make your caramel sauce.</li><li>Combine sugar and water in saucepan over medium-high heat.</li><li>When the sugar is a golden amber color turn off the heat and add the warmed heavy cream, stirring constantly with the wooden spoon. The sauce will react violently and bubble up; this is normal.</li><li>Continue stirring and add the butter. Set aside to cool for a few minutes.</li><li>Brush the glaze over the cake while the caramel is still warm.</li><li>You will have leftover caramel sauce. Store in an airtight container in the fridge. Warm in the microwave for 15-30 seconds before use. You can drizzle some sauce on the plate before serving a slice of cake.</li></ol>",
