        "summary": "The recipe Wild Blueberry Lemon Muffins can be made <b>in approximately 45 minutes</b>. For <b>56 cents per serving</b>, you get a breakfast that serves 14. One portion of this dish contains approximately <b>3g of protein</b>, <b>5g of fat</b>, and a total of <b>147 calories</b>. 4 people were glad they tried this recipe. If you have vanillan extract, lemon juice, powdered sugar, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 20%</b>, which is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/wild-blueberry-lemon-muffins-with-lemon-glaze-52082\">Wild Blueberry Lemon Muffins With Lemon Glaze</a>, <a href=\"https://spoonacular.com/recipes/wild-blueberry-lemon-cheesecake-mini-muffins-539265\">Wild Blueberry Lemon Cheesecake Mini Muffins</a>, and <a href=\"https://spoonacular.com/recipes/wild-blueberry-mini-muffins-159507\">Wild Blueberry Mini-Muffins</a>.",
