        "summary": "If you have about <b>45 minutes</b> to spend in the kitchen, Barbecued Baby Back Pork Ribs and Bush's Grillin' Beans might be a great <b>gluten free and dairy free</b> recipe to try. For <b>$1.96 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. This recipe serves 2. One portion of this dish contains approximately <b>30g of protein</b>, <b>23g of fat</b>, and a total of <b>538 calories</b>. Not a lot of people made this recipe, and 2 would say it hit the spot. If you have baby back pork ribs, coriander, cider vinegar, and a few other ingredients on hand, you can make it. It works well as a budget friendly main course. It is brought to you by Foodista. With a spoonacular <b>score of 58%</b>, this dish is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/cuban-pork-chops-with-bushs-black-bean-fiesta-grillin-beans-1297303\">Cuban Pork Chops with Bush’s Black Bean Fiesta Grillin’ Beans</a>, <a href=\"https://spoonacular.com/recipes/cuban-pork-chops-with-bushs-black-bean-fiesta-grillin-beans-429139\">Cuban Pork Chops with Bush’s Black Bean Fiesta Grillin’ Beans</a>, and <a href=\"https://spoonacular.com/recipes/cuban-pork-chops-with-bushs-black-bean-fiesta-grillin-beans-1214827\">Cuban Pork Chops with Bush’s Black Bean Fiesta Grillin’ Beans</a>.",
