        "instructions": "<ol><li>Before Cooking:</li><li>A. Before marinating the ribs, remove the white membrane on the underside of the ribs. Start the removal with a sharp knife then use a paper towel to grab it and simply pull it off.</li><li>B. Mix all the marinade ingredients and pour over ribs in a flat casserole dish. If you have any extra marinade, don't pour it on and save it for after the ribs are cooked.</li><li>C. Marinate the ribs for at least 1 hour; but preferably for several hours before cooking.</li><li>Cooking:</li><li>1. Spray the BBQ grill rack with oil so the ribs wont stick. Place ribs on the grill, bone side down over low to medium heat; about 300*F.</li><li>2. Cook for about 20 minutes; and when the ribs start getting burnt on the underside, place them on aluminum foil so they cook but dont burn. Cook for another 20 minutes or so until done. A cut next to a bone will show no red.</li><li>3. Cut into individual ribs and serve hot with grillin' beans or whatever you choose. Then enjoy the wonderful flavor.</li></ol>",
