        "summary": "You can never have too many side dish recipes, so give 15 Minute Healthy Dark Chocolate Truffles a try. One serving contains <b>169 calories</b>, <b>3g of protein</b>, and <b>13g of fat</b>. This gluten free, dairy free, lacto ovo vegetarian, and vegan recipe serves 12 and costs <b>49 cents per serving</b>. If you have dates, slivered almonds, agave nectar, and a few other ingredients on hand, you can make it. A few people made this recipe, and 39 would say it hit the spot. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 45%</b>. This score is good. <a href=\"https://spoonacular.com/recipes/dark-chocolate-truffles-473154\">Dark Chocolate Truffles</a>, <a href=\"https://spoonacular.com/recipes/dark-chocolate-truffles-520794\">Dark chocolate truffles</a>, and <a href=\"https://spoonacular.com/recipes/coconut-dark-chocolate-truffles-695869\">Coconut-Dark Chocolate Truffles</a> are very similar to this recipe.",
